import React from "react";

class Select extends React.Component {
	render () {
		const { value, input } = this.props;
		return (
			<fieldset>
				<label>
					selecione
					<br></br>
					<select value={value} onChange={input}>
						<option>abc</option>
						<option>def</option>
						<option>ghi</option>
					</select>
				</label>
			</fieldset>
		)
	}
}

export default Select;
